import React from 'react';

function TestResultsDashboard({ summary }) {
  const {
    total = 0,
    passed = 0,
    failed = 0,
    duration = '‚Äî',
    languageBreakdown = []
  } = summary;

  const passRate = total > 0 ? ((passed / total) * 100).toFixed(2) : 0;

  return (
    <div className="p-4 grid grid-cols-1 md:grid-cols-2 gap-4">
      {/* Summary Card */}
      <div className="bg-white shadow-md rounded-2xl p-4">
        <h2 className="text-xl font-semibold mb-4">üìä Test Summary</h2>
        <div className="space-y-2 text-lg">
          <div>‚úÖ <strong>Total Tests Run:</strong> {total}</div>
          <div>üü¢ <strong>Passed:</strong> {passed}</div>
          <div>üî¥ <strong>Failed:</strong> {failed}</div>
          <div>üìà <strong>Pass Rate:</strong> {passRate}%</div>
          <div>‚è±Ô∏è <strong>Execution Time:</strong> {duration}</div>
        </div>
      </div>

      {/* Language Breakdown Card */}
      <div className="bg-white shadow-md rounded-2xl p-4">
        <h2 className="text-xl font-semibold mb-4">üß™ Test Breakdown by Language</h2>
        <ul className="text-lg list-disc list-inside">
          {languageBreakdown.map((lang, idx) => (
            <li key={idx}>
              {lang.name}: {lang.total} tests, {lang.passRate}% pass
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default TestResultsDashboard;
